let redirectUrl=null;function inesonicSpeedSentrySignupRedirect(){console.log(redirectUrl);window.location.href=redirectUrl}jQuery(document).ready(function(a){jQuery("#inesonic_speedsentry_signup_redirect").click(function(b){jQuery.ajax({type:"POST",url:ajax_object.ajax_url,timeout:21000,data:{action:"inesonic_speedsentry_signup_generate_nonce"},dataType:"json",async:false,success:function(c){if(c!==null){if(c.status=="OK"){let signupUrl=c.signup_url;let nonce=c.nonce;let siteUrl=c.site_url;let query=new URLSearchParams({sn:nonce,url:siteUrl,redirect:window.location.href});redirectUrl=signupUrl+"?"+query.toString();setTimeout(inesonicSpeedSentrySignupRedirect,500)}else{alert("Error: "+c.status)}}else{alert("Error: Empty response")}},error:function(c,e,d){alert("Error: "+d)}})})});